const projectsCollection=document.querySelector(".projects-collection");fetch("https://raw.githubusercontent.com/PrimeSolar/web-developer/refs/heads/main/index.html").then((e=>e.text())).then((e=>{const r=(new DOMParser).parseFromString(e,"text/html");Array.from(r.querySelectorAll(".project-card")).forEach((e=>{const r=e.querySelector(".project-title").innerHTML.trim(),t=e.querySelector(".button-container > a:nth-of-type(1)").href,o=e.querySelector(".button-container > a:nth-of-type(2)").href,n=document.createElement("div");n.classList.add("project-card"),n.innerHTML=`<p><strong>${r}</strong></p>\n      <ul>\n        <li><a href=${t} rel="noopener noreferrer">GitHub</a></li>\n        <li><a href=${o} rel="noopener noreferrer">Live Demo</a></li>\n      </ul>\n      `,projectsCollection.appendChild(n)}))})).catch(console.error);
